import './home.css'
import Navbar from '../navbar/Navbar'

import React from 'react'

function Home() {

  fetch('https://dummyjson.com/products')
.then(res => res.json())
.then(console.log);

  return (
      <div>
        <Navbar heading={'Home page'} />
      </div>
  )
}

export default Home
